import './Header.css';

function Header() {
    return (
        <header className="header">
            <ul>
                <li><a href="https://github.com/Bastctt"><i className="material-icons">github</i></a></li>
                <li><a href=""></a></li>
            </ul>
        </header>
    )
}

export default Header;
